import React from "react";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import PropTypes  from 'prop-types';
import Typography from "@mui/material/Typography";
import { Button, Grid, Stack, Toolbar, CssBaseline, useScrollTrigger, Container } from "@mui/material";
import { Link, useNavigate } from "react-router-dom";
import IconButton from '@mui/material/IconButton';
import Menu from '@mui/material/Menu';
import MenuIcon from '@mui/icons-material/Menu';

import "./navbar.css"
import { border } from "@mui/system";

function ElevationScroll(props) {
  const { children, window } = props;
  // Note that you normally won't need to set the window ref as useScrollTrigger
  // will default to window.
  // This is only being set here because the demo is in an iframe.
  const trigger = useScrollTrigger({
    disableHysteresis: true,
    threshold: 0,
    target: window ? window() : undefined,
  });
  return React.cloneElement(children, {
    elevation: trigger ? 4 : 0,
  });
}

export default function NavBar(props) {
  const [anchorElNav, setAnchorElNav] = React.useState(null);
  const [anchorElUser, setAnchorElUser] = React.useState(null);

  const handleOpenNavMenu = (event) => {
    setAnchorElNav(event.currentTarget);
  };
  const handleOpenUserMenu = (event) => {
    setAnchorElUser(event.currentTarget);
  };

  const handleCloseNavMenu = () => {
    setAnchorElNav(null);
  };

  const handleCloseUserMenu = () => {
    setAnchorElUser(null);
  };


  return (
    <div>
    <React.Fragment>
      <CssBaseline />
      <ElevationScroll {...props}>
        <AppBar  position="static" sx={{background:"rgba(255, 255, 255, 0.6)", }}>
        <Container maxWidth="xl">
          <Toolbar disableGutters>
            <Box sx={{ flexGrow: 1, display: { xs: 'flex', md: 'none' } }}>
            <IconButton
                    size="large"
                    aria-label="account of current user"
                    aria-controls="menu-appbar"
                    aria-haspopup="true"
                    onClick={handleOpenNavMenu}
                    color="inherit"
                  >
                    <MenuIcon />
                  </IconButton>
                  <Menu
                    id="menu-appbar"
                    anchorEl={anchorElNav}
                    anchorOrigin={{
                      vertical: 'bottom',
                      horizontal: 'left',
                    }}
                    keepMounted
                    transformOrigin={{
                      vertical: 'top',
                      horizontal: 'left',
                    }}
                    open={Boolean(anchorElNav)}
                    onClose={handleCloseNavMenu}
                    sx={{
                      display: { xs: 'block', md: 'none' },
                    }}
                  >
              <Grid container direction={'row'} spacing={2} sx={{display: { md: 'flex' }, justifyContent:"space-between"}} >
                <Grid item xs={2}>
                  <Link to='/'>
                    <span style={{ color: 'white', textDecoration: 'none' }}>Find-<span style={{ color: '#308335'}}>A</span>-Crop</span>
                  </Link>
                </Grid>
                <Grid item xs={2}>
                  <Link to='/'>
                    <span style={{ color: 'white', textDecoration: 'none' }}>Name-<span style={{ color: '#308335'}}>A</span>-Crop</span>
                  </Link>
                </Grid>
                <Grid item xs={1}>
                  <Link to='/about-us'>
                    <span style={{ color: 'white', textDecoration: 'none' }}>About Us</span>
                  </Link>
                </Grid>
                <Grid item xs={1}>
                  <Link to='/about-us'>
                    <span style={{ color: 'white', textDecoration: 'none' }}>Predict</span>
                  </Link>
                </Grid>
                <Grid item xs={1}>
                  <Link to='/about-us'>
                    <span style={{ color: 'white', textDecoration: 'none' }}>Contact</span>
                  </Link>
                </Grid>

                <Grid item xs={1}>
                <Link to="/signup">
                     <span style={{ color: 'white', textDecoration: 'none' }}> SIGNUP</span>
                  </Link>
            </Grid>
                <Grid item xs={1}>
                  <Link to='/login'>
                    <Button
                      variant="contained"
                      size="small"
                      sx={{
                        backgroundColor: "#308335",
                      }}
                    >
                      LOGIN
                    </Button>
                  </Link>
                </Grid>
              </Grid>
              </Menu>
            </Box>

            <Box sx={{ flexGrow: 0,display: { xs: 'none', md: 'flex' } }}>
            <Grid container direction={'row'} spacing={2} sx={{display: { md: 'flex' }, justifyContent:"space-between"}} >
                <Grid item xs={2}>
                  <Link to='/'>
                    <span style={{ color: 'white', textDecoration: 'none' }}>Find-<span style={{ color: '#308335'}}>A</span>-Crop</span>
                  </Link>
                </Grid>
                <Grid item xs={2}>
                  <Link to='/'>
